import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'locations-tacocloud',
  templateUrl: 'locations.component.html'
})

export class LocationsComponent implements OnInit {
  constructor() { }

  ngOnInit() { }
}
<cloud-title>Come visit one of our taco showrooms</cloud-title>

<p>Although our tacos are conveniently available online, we love to have
  our taco artists make in-person appearances at one of our taco showrooms.
  Choose the location nearest you. We'll resist the urge to ask you for an
  autograph.</p>
